// app/javascript/components/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HelloWorld from './HelloWorld';

const App = () => (

  <Router>
    <Routes>
      <Route path="/" element={<HelloWorld/>} />

    </Routes>
  </Router>
);

export default App;
